import React from 'react';
import Navigation from '../../components/Navigation/Navigation';
import './Home.css';

const Home = (props) => {
  const route = props.location.pathname;

  if(route === "/Signup") {
    return (
      <div className="homepage">
        <Navigation />
      </div>
    );
  } else if(route === "/Login") {
    return (
      <div className="homepage">
        <Navigation />
      </div>
    );
  } else if(route === "/") {
    return (
      <div className="homepage">
        <Navigation />
      </div>
    );
  }
};

export default Home;
